import "./HomePage.css";
import { Link } from "react-router-dom";
import { signInWithGoogle } from "../db/firebase.js";

import { auth } from "../db/firebase";


function LandingFrameMessage(props) {
  const user =(props.location && props.location.state) || {};
  return (
    <div className="Landing-Frame-Message">
      <div className="Landing-Title"><h1>
        Hello, <span></span>
        {user.displayName}
      </h1>
      </div>

      <div className="Landing-description">

      <img src={user.photoURL} alt="" />
      <button className="button signout" onClick={() => auth.signOut()}>
        Sign out
      </button>
      </div>
      <br />
    </div>
  );
}

function LandingFrame({user}) {
  return (
    <div
      className="Landing-Frame"
      style={{
        backgroundImage: "url('/images/landing-page-background.jpg')",
      }}
    >
      <LandingFrameMessage user={user}/>
    </div>
  );
}
function HomePage({user}) {
  return (
    <div>
      <LandingFrame user={user}/>
      <br />
    </div>
  );
}
export default HomePage;
